import React from "react";
import "./style.css";

function SearchForm(props) {
  return (

    <div className="form-group">
    <input
            type="text"
            value={this.state.search}
            ref="search"
            onChange={this.handleInputChange}
            placeholder="type name here"
          />
       </div>

  );
}

export default SearchForm;
